text:
@Q_Hyphen @TheFibreman @GeorgeAylett @HappierAccident Maybe you haven't been paying attention but all the credible impact assessments show we're heading for a GDP hit at least 3x the one we took in the global crash
Business is warning us,  unions are warning us, NHS staff are warning us.
How much more do you need b4 you're convinced

@Q_Hyphen @TheFibreman @GeorgeAylett @HappierAccident Labour say we are better off in the EU #RemainReform
Corbyn says he would still vote Remain.

EU anti-tax avoidance reforms that were announced March 2016 come into force in 2019. That's why 5 of the richest tax-avoiding businessmen in the UK bought Brexit https://t.co/oKMH8jaBMf

@TheFibreman @GeorgeAylett @HappierAccident That's really presumptuous of you, and only serves to enable Labour's failure to stand up &amp; try to #StopBrexit.

Most people I speak to who voted Leave weren't even aware of Labour's #RemainReform stance.
Unsurprising it didn't get much coverage as it rightly blames Tories not EU https://t.co/jY1d1p37pz

@GeorgeAylett @HappierAccident After all, the Big Brexit Survey 2018 results from 80,000 people said 82% of Labour members &amp; 81% of Labour voters would back a referendum on the terms of Britain’s departure from EU.

39% said we should “abandon Brexit completely” &amp; keep Britain in the EU
https://t.co/PA0ZgMRzs0

@GeorgeAylett @HappierAccident 2 year anniversary Survation poll has 48% in favour of a second referendum while only 25% oppose it. 
#PeoplesVote
https://t.co/b5I7Si83Rm

@GeorgeAylett @HappierAccident He could've sent a video of support. If he'd wanted to. 
Could've not whipped the Lords to abstain on a #PeoplesVote too.

People are frustrated because it's hard not to interpret this as Corbyn not wanting to let The People have final say on whether we should commit Brexit

@SiHarrisonMorse @nataliefaulkner 1) Really?
2) It wasn’t clear
3) Why though? Labour’s position is extremely clear and the party have ruled out a 2nd referendum countless times?

@nataliefaulkner This is one of the responses I’ve already received: “he should’ve sent a video” 🤦‍♂️ 

Visiting the place at the heart of the refugee crisis and listening to people’s experiences can help solve the crisis by having input from the people impacted by it.

But ‘stop Brexit init’
